// }

export class App extends Component () {

  setBoard(){
    for(let i=0; i <= 9; i++){
        console.log({i});
    }
  }


  render() {

    return(
      <div className="App">
        <header className="App-header">
          {/* <div id='board' onClick={(e)=>this.selectedBox(e)}> */}
            <div>
              {this.setBoard()}
            </div>
          {/* </div> */}
        </header>
      </div>
    )

  }

};


export default App;
